import React from "react";
import {Button,Col,CardImg, Card,Row, CardBody, CardTitle} from "reactstrap";
import "./producto.css";

function Producto(){
  return(
    <Col lg="3">
    <Card className="Card"> <CardImg src="https://image.shutterstock.com/image-photo/headphones-isolated-white-wireless-front-600w-1663324480.jpg"></CardImg>
          <CardBody><CardTitle>Audifonos facheros</CardTitle>
          <Button className="Button">Ver Mas</Button><Button className="Button">Comprar</Button>
          </CardBody>
    </Card>
    </Col>
  );
}

export default Producto;
